description:
Access 360 World Heritage: Mount Fuji

Travel Documentary hosted by Graig Sechler, published by National Geographic in 2013 - English narration


Information
------------------------------

Access 360Ã‚Â° World Heritage: Mount Fuji
Recently added to the world heritage list as a cultural asset, the iconic Mt. Fuji is a well-known symbol of Japan. Every year the volcano's scenic beauty draws more and more visitors from around the world. Dedicated mountain rangers, scientists, and eco-volunteers are working hard to preserve and protect the mountain from mankind... and protect mankind from the mountain.

